"original": |2-
     o  'compression-error': The Job was aborted by the system because the
        Printer encountered an error in the Document data while
        decompressing it.  If the Printer posts this reason, the Document
        data has already passed any tests that would have led to the
        'unsupported-compression' "job-state-reasons" value.
"fixed": |-
  -  'compression-error': The Job was aborted by the system because the Printer encountered an error in the Document data while decompressing it.  If the Printer posts this reason, the Document data has already passed any tests that would have led to the 'unsupported-compression' "job-state-reasons" value.
"ko": |-
  - 'compression-error': 프린터의 압축을 푸는 동안 문서 데이터에 오류가 발생하여 작업이 시스템에 의해 중단되었습니다. 프린터가 이 이유를 게시하는 경우 문서 데이터는 '지원되지 않는 압축' "작업 상태 이유" 값을 초래하는 모든 테스트를 이미 통과한 것입니다.
